pragma solidity 0.5.16;

import "./GoToken.sol";
import "./SafeMath.sol";

contract GoFarm 
{
    using SafeMath for uint256;

    struct UserData 
    { 
        uint256 stakingDeposit;
        uint256 stakingBlock;
    }

    string  private _name = "Gō Farm";
    GoToken private _goToken;
    uint256 private _farmTreasury;
    uint256 private _rewardsFund;
    uint256 private _totalGoStaked;
    uint256 private _lastTransferBlock;
    uint256 private _goTransferPerBlock = 34000000000000; //0.000034 Gō
    uint256 private _depositFee = 10; //Deposit fee: 10%
    uint256 private _harvestCooldownBlocks = 28800;
    uint256 private _stakingBlockRange = 10512000;
    uint256 private _startFarmReward = 1000000000000000000; //1 Gō
    uint256 private _decimalFixMultiplier = 1000000000000000000;

    mapping(address => UserData) private _userData;

    constructor(GoToken goToken) public 
    {
        _goToken = goToken;
        _lastTransferBlock = block.number;
    }

    function getName() external view returns (string memory)
    {
        return _name;
    }

    function getFarmTreasury() external view returns (uint256)
    {
        return _farmTreasury;
    }

    function getRewardsFund() external view returns (uint256)
    {
        return _rewardsFund;
    }

    function getTotalGoStaked() external view returns (uint256)
    {
        return _totalGoStaked;
    }

    function getDepositFee() external view returns (uint256)
    {
        return _depositFee;
    }

    function getHarvestCooldownBlocks() external view returns (uint256)
    {
        return _harvestCooldownBlocks;
    }

    function getStakingBlockRange() external view returns (uint256)
    {
        return _stakingBlockRange;
    } 

    function updateRewardsFund() public
    {
        if (block.number > _lastTransferBlock)
        {
            uint256 numberOfBlocks = block.number.sub(_lastTransferBlock);
            uint256 amount = numberOfBlocks.mul(_goTransferPerBlock);

		    if (amount > _farmTreasury)
		        amount = _farmTreasury;

		    //Update farm data
		    _farmTreasury = _farmTreasury.sub(amount);
		    _rewardsFund = _rewardsFund.add(amount);
		    _lastTransferBlock = block.number;
        }
    }

    function donate(uint256 amount) external
    {
        require(amount > 0, "GoFarm: donate amount cannot be 0");

        _goToken.transferFrom(msg.sender, address(this), amount);

        _rewardsFund = _rewardsFund.add(amount);
    }

    function deposit(uint256 amount) external 
    {
        uint256 fee;
        uint256 netAmount;

        require(amount >= 100, "GoFarm: deposit amount too low");

        updateRewardsFund();

        _goToken.transferFrom(msg.sender, address(this), amount);

        //Compute fee and net amount
        fee = (amount.mul(_depositFee)).div(100);
        netAmount = amount.sub(fee);

        //Update farm data
        _farmTreasury = _farmTreasury.add(fee);
        _totalGoStaked = _totalGoStaked.add(netAmount);

        //Update user data
        _userData[msg.sender].stakingDeposit = _userData[msg.sender].stakingDeposit.add(netAmount);
        _userData[msg.sender].stakingBlock = block.number;
    }

    function withdraw() external
    {
        uint256 stakingDeposit = _userData[msg.sender].stakingDeposit;

        require(stakingDeposit > 0, "GoFarm: withdraw amount cannot be 0");

        uint256 blocksStaking = computeBlocksStaking();

        if (blocksStaking > _harvestCooldownBlocks)
            harvest();

        _userData[msg.sender].stakingDeposit = 0;
        _totalGoStaked = _totalGoStaked.sub(stakingDeposit);
        _goToken.transfer(msg.sender, stakingDeposit);
    }

    function computeUserReward() public view returns (uint256)
    {
        require(_userData[msg.sender].stakingDeposit > 0, "GoFarm: staking deposit is 0");

        uint256 userReward = 0;

        uint256 blocksStaking = computeBlocksStaking();

        if (blocksStaking > 0)
	    {
	        uint256 userBlockRatio = _decimalFixMultiplier;

	        if (blocksStaking < _stakingBlockRange)
	            userBlockRatio = blocksStaking.mul(_decimalFixMultiplier).div(_stakingBlockRange); 

		    uint256 userDepositRatio = _decimalFixMultiplier;

		    if (_userData[msg.sender].stakingDeposit < _totalGoStaked)
		        userDepositRatio = _userData[msg.sender].stakingDeposit.mul(_decimalFixMultiplier).div(_totalGoStaked);

		    uint256 totalRatio = userBlockRatio.mul(userDepositRatio).div(_decimalFixMultiplier);

		    userReward = totalRatio.mul(_rewardsFund).div(_decimalFixMultiplier);
		}

		return userReward;
    }

    function harvest() public 
    {
        require(_userData[msg.sender].stakingDeposit > 0, "GoFarm: staking deposit is 0");

        uint256 blocksStaking = computeBlocksStaking();

        require(blocksStaking > _harvestCooldownBlocks, "GoFarm: harvest cooldown in progress");

        updateRewardsFund();

    	uint256 userReward = computeUserReward();

        _rewardsFund = _rewardsFund.sub(userReward);

        _goToken.transfer(msg.sender, userReward);

        _userData[msg.sender].stakingBlock = block.number;
    }

    function startFarm() external
    {
        require(_totalGoStaked == 0, "GoFarm: farm is already started");
        require(_rewardsFund >= _startFarmReward, "GoFarm: insufficient reward funds");

        _rewardsFund = _rewardsFund.sub(_startFarmReward);

        _userData[msg.sender].stakingDeposit = _startFarmReward; 
        _userData[msg.sender].stakingBlock = block.number;

        _totalGoStaked = _startFarmReward;
    }

    function getStakingDeposit() external view returns (uint256)
    {
        UserData memory userData = _userData[msg.sender];

        return (userData.stakingDeposit);
    }

    function getStakingBlock() external view returns (uint256)
    {
        UserData memory userData = _userData[msg.sender];

        return (userData.stakingBlock);
    }

    function computeBlocksStaking() public view returns (uint256)
    {
        uint256 blocksStaking = 0;

        if (_userData[msg.sender].stakingDeposit > 0)
            blocksStaking = block.number.sub(_userData[msg.sender].stakingBlock);

        return blocksStaking;
    }
}
